class FormatTests(TestCase):
    def test_format_print_for_magnified_sample(self):
        """Check SVG files are formatted correctly"""
        output = format_print_for_magnified_sample('PC.354', PER_SAMPLE_SVG_354,
            GLOBAL_SVG)
        self.assertEquals(output, RESULT_A)

        output = format_print_for_magnified_sample('PC.607', PER_SAMPLE_SVG_607,
            GLOBAL_SVG)
        self.assertEquals(output, RESULT_B)

    def test_format_print_for_magnified_sample_exceptiosn(self):
        """Check exceptions are being raised on bad inputs"""
        self.assertRaises(RuntimeError, format_print_for_magnified_sample,
            'SAMBA!', '', GLOBAL_SVG)
        self.assertRaises(RuntimeError, format_print_for_magnified_sample,
            'SAMBA!', PER_SAMPLE_SVG_354, GLOBAL_SVG)
        self.assertRaises(RuntimeError, format_print_for_magnified_sample,
            'PC.IDONTEXIST', PER_SAMPLE_SVG_354, GLOBAL_SVG)

